import { Link } from "react-router-dom";

function Navbar({ isAuthenticated, logout }) {
  return (
    <nav style={{ padding: "10px", backgroundColor: "#333", color: "#fff" }}>
      <ul style={{ display: "flex", listStyleType: "none", gap: "20px" }}>
        <li><Link to="/" style={{ color: "#fff", textDecoration: "none" }}>Centros CÃ­vicos</Link></li>
        <li><Link to="/instalaciones" style={{ color: "#fff", textDecoration: "none" }}>Instalaciones</Link></li>
        <li><Link to="/actividades" style={{ color: "#fff", textDecoration: "none" }}>Actividades</Link></li>
        
        {!isAuthenticated ? (
          <>
            <li><Link to="/login" style={{ color: "#fff", textDecoration: "none" }}>Login</Link></li>
            <li><Link to="/registro" style={{ color: "#fff", textDecoration: "none" }}>Registro</Link></li>
          </>
        ) : (
          <li><Link to="/mi-cuenta" style={{ color: "#fff", textDecoration: "none" }}>Mi Cuenta</Link></li>
        )}
      </ul>
    </nav>
  );
}

export default Navbar;
